import '../App.css';
import React from 'react';
import { NavLink } from 'react-router-dom';

const NavBar = ({ onLogout, doctorName }) => {
    return (
        <nav className='w-1/5 border px-10 py-10 h-screen fixed flex flex-col justify-between'>
            <ul className='flex flex-col gap-10'>
                <li>
                    <Link className='rounded-xl text-sm px-5 py-3 w-full block navButton' to="/doctor">Doctor</Link>
                </li>
                <li>
                    <Link className='rounded-xl text-sm px-5 py-3 w-full block navButton' to="/newPatient">New Patient</Link>
                </li>
                <div className='w-full line bg-opacity-10 rounded-full bg-black -mb-2 -mt-2'></div>
                <li>
                    <button className='rounded-xl text-sm px-5 py-3 w-full text-left navButton' onClick={onLogout}>Log Out</button>
                </li>
            </ul>

            <div className='border-2 border-opacity-10 border-black rounded-xl px-5 py-3'>
                <h1 className='text-sm capitalize'>
                    {doctorName}
                </h1>
            </div>
        </nav>
    );
};

export default NavBar;
